import React, { Component, useState } from 'react';
import EventTab from './eventTab';
import '../App.css';
//props:
// fixtures a list of objects where each object is an event
// addGame (fnction reference)
// displayLoginStatus
// displayLogin
// displayRegistration
// handleLoginRegistrationClick
class EventTabs extends Component {
    constructor(props) {
        super(props);
        this.state = {
            username: '',
            password: '',
            firstName: '',
            lastName: '',
        }
    }

    render() { 
        return (
            <React.Fragment>

                {
                    this.props.fixtures.map( event => (
                        <div key={ event.id } class="eventTab">
                            <EventTab key={event.id} 
                            id = {event.id}
                            home ={event.home}
                            away ={event.away}
                            date = {event.date}
                            timezone ={event.timezone}
                            location = {event.location}
                            stadium = {event.stadium}
                            homeImg = {event.homeImg}
                            awayImg = {event.awayImg}
                            time = {event.time}
                            addGame = {this.props.addGame}
                            homeScore = {event.homeScore}
                            awayScore = {event.awayScore}
                            displayButton={this.props.displayButton}
                            />
                        </div>

                    ))
                }

                {/**display login/registration message */}
                <div class={this.getClasses("message")}>
                    <h1>You are not logged in!</h1>
                    <div class="login-buttons">
                        <button onClick = { ()=> this.props.handleLoginRegistrationClick("login") }>
                            <p>Log in</p>
                        </button>
                        <button onClick ={ () => this.props.handleLoginRegistrationClick("registration") }>
                            <p>Register</p>
                        </button>
                    </div>     
                </div>

                {/**login-gui */}
                <div class={this.getClasses("login")}>
                    {/**
                     * <button class="login-register-back-button" onClick = { () => this.props.handleLoginRegistrationClick("back")}>Back</button>
                    <div>
                        <h3>Username</h3>
                        <div class="input-group">
                            <input type="text" class="form-control rounded" placeholder="Username" aria-label="text" aria-describedby="text-addon" />
                        </div>
                    </div>
                    <div>
                        <h3>Password</h3>
                        <div class="input-group">
                            <input type="text" class="form-control rounded" placeholder="Password" aria-label="text" aria-describedby="text-addon" />
                        </div>
                    </div>
                     */}
                <button class="login-register-back-button" onClick = { () => this.props.handleLoginRegistrationClick("back")}>Back</button>
                <form onSubmit = { this.submit()}>
                    <label>
                        Username:
                    </label>
                        <div class="input-group">
                            <input type="text" 
                                        value={this.state.username}
                                        onChange={this.handleChange}
                                        class="form-control rounded" 
                                        placeholder="Username"  />
                        </div>
                    <label>
                        Password: 
                    </label>
                        <div class="input-group">
                            <input type="text" 
                                        value ={this.state.password}
                                        onChange = {this.handleChange}
                                        class="form-control rounded" 
                                        placeholder="Password" />
                        </div>
                        <input type="submit" value="Submit"></input>
                </form>



                </div>

                {/** registration-gui */}
                <div class= {this.getClasses("registration")}>
                    <button class="login-register-back-button"  onClick = { () => this.props.handleLoginRegistrationClick("back")}>Back</button>
                    <div>
                        <h3>First Name</h3>
                        <div class="input-group">
                            <input type="text" class="form-control rounded" placeholder="First name" aria-label="text" aria-describedby="text-addon" />
                        </div>
                    </div>
                    <div>
                        <h3>Last Name</h3>
                        <div class="input-group">
                            <input type="text" class="form-control rounded" placeholder="Last name" aria-label="text" aria-describedby="text-addon" />
                        </div>
                    </div>
                    <div>
                        <h3>Username</h3>
                        <div class="input-group">
                            <input type="text" class="form-control rounded" placeholder="Username" aria-label="text" aria-describedby="text-addon" />
                        </div>
                    </div>
                    <div>
                        <h3>Password</h3>
                        <div class="input-group">
                            <input type="text" class="form-control rounded" placeholder="Password" aria-label="text" aria-describedby="text-addon" />
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
    getClasses(divType) {

        if (divType==="message") {
            console.log("displayLoginStatus: ", this.props.displayLoginStatus);
            if (this.props.displayLoginStatus===false) return "display-none";
            else return "login-message-gui";
        }

        if (divType==="login") {
            console.log("displayLoginStatus: ", this.props.displayLogin);
            if (this.props.displayLogin===false) return "display-none";
            else return "login-gui";
        }

        if (divType==="registration") {
            console.log("displayRegistration: ", this.props.displayRegistration);
            if (this.props.displayRegistration===false) return "display-none";
            else return "registration-gui";
        }
    }

    handleChange = (changeType) => {
        const {name, value} = event.target;
        this.setState( { [name] : value} );
    }

    submit = (submitType) => {
        if (submitType==='login')
            this.props.handleLoginSubmit({username: this.state.username, password: this.state.password});
        else if (submitType==="registration")
            this.props.handleReigstrationSubmit({username: this.state.username, password: this.state.password,
                                                                            firstName: this.state.firstName, lastName: this.state.lastName});

    }


}

export default EventTabs;
